// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

contract Voting{
    //一个mapping来存储候选人的得票数
    mapping(address person=> uint votes) public voteMapping;
    address[] public persons;


    //一个vote函数，允许用户投票给某个候选人
    function setVote(address p,uint vot) public {
        voteMapping[p]+=vot;
        persons.push(p);
    }

    //一个getVotes函数，返回某个候选人的得票数
    function getVote(address p) public view returns (uint) {
        return voteMapping[p];
    }

    //一个resetVotes函数，重置所有候选人的得票数
    function resetAll() public {
        for (uint i = 0; i < persons.length; i++) {
            voteMapping[persons[i]] = 0;
        }
    }


}

